import React from "react";
import "./style-post.css"
import Counter from "../../UI/Counter/Counter.jsx"
import MyButton from "../button/Button";
import bubusic from "../../../image/bubusic.png"


const PostItem = (props) => {

    return (
        <div className="post">
            <div>
                <strong className="title"> {props.number}. {props.post.title} </strong>
                <div style={{display: 'inline-block'}}>
                    {/* <img src={bubusic} className="photo" /> */}
                    <div className="body"> <text >{props.post.body}</text> </div>

                </div>

                <Counter />
            </div>
            <div className="post_btn">
                <MyButton onClick={() => props.remove(props.post)}>Delete</MyButton>

            </div>
        </div>
    )
};

export default PostItem;
